import "./Home.css";
import React, { Component } from "react";
// Class Component
class Home extends Component {
  state = {};
  render() {
    return <div className="home">{this.props.text}</div>;
  }
}
class Footer extends Component {
  state = {};
  render() {
    return (
      <nav className="footer">
        {this.props.text}
        <ul>
          <li>
            <a>Link 1</a>
          </li>
          <li>
            <a>Link 2</a>
          </li>
          <li>
            <a>Link 3</a>
          </li>
        </ul>
      </nav>
    );
  }
}

export { Home, Footer };
